import React, { Component } from 'react'

class toggle extends Component {
    render() {
        const {isdisplay}=this.props
        let divClasses="nav-head";
        let iconClasses="fa fa-bars";
        if (isdisplay){
            divClasses="nav-head is-visible";
        }
        return (
           <button className="head-toggle" onClick={this.props.toggleClick}>
                <i className="fa fa-bars" aria-hidden="true" style={{color:'#fff'}}></i>
            </button>
        )
    }
}
export default toggle
